import LandingOption from './screens/LandingOption';
import LandingPage from './screens/LandingPage';

export default function App() {
  return (
    <DoctorInitial />
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
